import React from 'react';
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import List from './List';
import Header from './Header';
import Home from './Home';
import Detail from './Detail';
import Marvel from './Marvel';
import Pixar from './Pixar';

export const MyRoutes = {
    HOME: '/',
    DETAIL: '/:idFilm',
    MARVEL: '/marvel',
    PIXAR: '/pixar',
    SELECTION: '/selection'

}

export const Selection = {
  MARVEL: 9
}

const Router = () => {

  return (
    <BrowserRouter>
        <Header />
        <Routes>
            <Route path={MyRoutes.HOME} element={<List />}/>
            <Route path={MyRoutes.DETAIL} element={<Detail />}/>
            <Route path={`${MyRoutes.SELECTION}/:id`} element={<List />}/>

            {/* <Route path={MyRoutes.MARVEL} element={<Marvel />}/>
            <Route path={MyRoutes.PIXAR} element={<Pixar />} /> */}
        </Routes>
    </BrowserRouter>
  )
}

export default Router
